import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import RoomResult from './RoomResult';

const SearchResultsPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { rooms, filters } = location.state || {};

  return (
    <div className="search-results-page">
      <div className="results-header">
        <h2 className="text-2xl font-bold text-center mb-4">Available Rooms</h2>
        {filters && (
          <p className="text-center text-gray-500 mb-4">
            {`From ${filters.startDate} to ${filters.endDate} | Type: ${filters.roomType}`}
          </p>
        )}
        <div className="text-center">
          <button
            onClick={() => navigate('/')}
            className="bg-gray-200 px-4 py-2 rounded-md hover:bg-gray-300"
          >
            Back to Search
          </button>
        </div>
      </div>
      {rooms?.length > 0 ? (
        <RoomResult roomSearchResults={rooms} />
      ) : (
        <p className="text-center text-red-600 mt-6">No rooms found.</p>
      )}
    </div>
  );
};

export default SearchResultsPage;
